import React from 'react'
import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'ID',
        selector: row => row.unique_id,
    },
    {
        name: 'Names',
        selector: (row) => <div className="user_info">
        <img src="/images/avatar.png" alt="" />
        <div className="name"><b>Jamal K</b></div>
        <div className="address"><small>263 Ossington Ove</small></div>
      </div>,
    },
    {
        name: 'Flight Risk',
        selector: row => row.risk,
    },
    {
        name: 'Monday',
        selector: row => row.day,
    },
];

const data = [
    {
        id: 1,
        unique_id: 'Beetlejuice',
        names: '1988',
        risk: '1988',
        day: '18'
    },

]


const OrderTable  = () => {
  return (
    <>
    <DataTable
            columns={columns}
            data={data}
            selectableRows
        />
    </>
  )
}

export default OrderTable
